import { NavLink } from 'react-router-dom';

export function AppBar() {
  return (
    <nav>
      <NavLinkStyled to="/shop">Shop</NavLinkStyled>
      <NavLinkStyled to="/cart">Shopping Cart</NavLinkStyled>
    </nav>
  );
}
